import React from 'react';

function Hello(props) {
  
    return (
        <>
            <ul>
                <li>姓名：{props.name}</li>
                <li>年龄：{props.age}</li>
                <li>性别：{ props.gender}</li>
        </ul>
        </>
    );
}

export default Hello;
